        private static string GetCharacter(string unicode)
        {
            unicode = unicode.Replace("&#x", string.Empty);
            unicode = unicode.TrimEnd(';');

            var code = int.Parse(unicode, NumberStyles.AllowHexSpecifier);
            return ((char)code).ToString();
        }

